import PlayedGame from "./PlayedGames/played-games";
import Records from "./Records/records";
import UserProfile from "./UserProfile/user-profile";

var routes = [
  {
    path: "/user-profile",
    name: "User Profile",
    icon: "tim-icons icon-single-02",
    component: UserProfile,
    layout: "/user-account",
  },
  {
    path: "/records",
    name: "Records",
    icon: "tim-icons icon-puzzle-10",
    component: Records,
    layout: "/user-account",
  },
  {
    path: "/game-played",
    name: "Game played",
    icon: "tim-icons icon-atom",
    component: PlayedGame,
    layout: "/user-account",
  },
];

export default routes;
